import Form from "./Component/Form/Form";
import Nav from "./Component/Nav/Nav";

function App() {
  return (
    <><Nav />
    <div className="md:container md:mx-auto">
      <div className="flex justify-center">
        <Form />
      </div>
    </div>
    </>
  );
}

export default App;
